import React, { useState, useEffect } from 'react';
import {
  Card,
  CardContent,
  Typography,
  List,
  ListItem,
  ListItemText,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField
} from '@mui/material';
import axios from 'axios';
import { format } from 'date-fns';
import { ru } from 'date-fns/locale';

interface Transaction {
  id: number;
  amount: number;
  type: string;
  description: string;
  created_at: string;
}

interface User {
  id: number;
  username: string;
  full_name: string;
  balance: number;
}

const Profile: React.FC = () => {
  const [user, setUser] = useState<User | null>(null);
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [depositDialog, setDepositDialog] = useState(false);
  const [depositAmount, setDepositAmount] = useState('');

  useEffect(() => {
    fetchUserData();
    fetchTransactions();
  }, []);

  const fetchUserData = async () => {
    try {
      const tg = window.Telegram.WebApp;
      const response = await axios.get(`/api/users/telegram/${tg.initDataUnsafe.user.id}`);
      setUser(response.data);
    } catch (error) {
      console.error('Ошибка при загрузке данных пользователя:', error);
    }
  };

  const fetchTransactions = async () => {
    try {
      const tg = window.Telegram.WebApp;
      const response = await axios.get(`/api/transactions/user/${tg.initDataUnsafe.user.id}`);
      setTransactions(response.data);
    } catch (error) {
      console.error('Ошибка при загрузке транзакций:', error);
    }
  };

  const handleDeposit = async () => {
    if (!user || !depositAmount) return;

    try {
      await axios.post('/api/transactions/deposit', {
        user_id: user.id,
        amount: parseFloat(depositAmount)
      });

      setDepositDialog(false);
      setDepositAmount('');
      fetchUserData();
      fetchTransactions();
    } catch (error) {
      console.error('Ошибка при пополнении баланса:', error);
    }
  };

  const getTransactionColor = (type: string) => {
    switch (type) {
      case 'deposit':
        return 'success.main';
      case 'withdrawal':
        return 'error.main';
      default:
        return 'text.primary';
    }
  };

  return (
    <>
      {user && (
        <Card sx={{ mb: 2 }}>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              {user.full_name}
            </Typography>
            <Typography variant="subtitle1" color="text.secondary">
              @{user.username}
            </Typography>
            <Typography variant="h6" sx={{ mt: 2 }}>
              Баланс: {user.balance} руб.
            </Typography>
            <Button
              variant="contained"
              color="primary"
              sx={{ mt: 2 }}
              onClick={() => setDepositDialog(true)}
            >
              Пополнить баланс
            </Button>
          </CardContent>
        </Card>
      )}

      <Typography variant="h6" sx={{ mb: 2 }}>
        История транзакций
      </Typography>
      <List>
        {transactions.map((transaction) => (
          <ListItem key={transaction.id} divider>
            <ListItemText
              primary={
                <Typography color={getTransactionColor(transaction.type)}>
                  {transaction.type === 'deposit' ? '+' : '-'}
                  {Math.abs(transaction.amount)} руб.
                </Typography>
              }
              secondary={
                <>
                  {transaction.description}
                  <br />
                  {format(new Date(transaction.created_at), 'PPp', { locale: ru })}
                </>
              }
            />
          </ListItem>
        ))}
      </List>

      <Dialog open={depositDialog} onClose={() => setDepositDialog(false)}>
        <DialogTitle>Пополнить баланс</DialogTitle>
        <DialogContent>
          <TextField
            label="Сумма"
            type="number"
            value={depositAmount}
            onChange={(e) => setDepositAmount(e.target.value)}
            fullWidth
            margin="normal"
            InputProps={{ inputProps: { min: 100 } }}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDepositDialog(false)}>Отмена</Button>
          <Button onClick={handleDeposit} color="primary">
            Пополнить
          </Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default Profile;
